import React from "react";

const Product = (props) => {

  const { category } = props







  return category === null ? (
    "Loading"
  ) : (
    <tr className="border-8 border-l-4 border-r-4 border-white">

      <td className="hidden pt-4 pb-4 md:table-cell">{category.name}</td>
      <td className="hidden pt-4 pb-4 md:table-cell">{category.products}</td>
      <td className="flex pt-4 pb-4 md:table-cell">
        <i className="fa fa-pen text-md font-semibold"></i>
        <i className="fa fa-trash text-md font-semibold"></i>
      </td>
    </tr>
  );
};

export default Product;
